create table books
(
    id                 serial  not null
        constraint books_pkey
            primary key,
    isbn               varchar not null,
    isbn_num           bigint,
    title              varchar not null,
    author             varchar not null,
    published_year     integer not null,
    total_reviews      bigint default 0,
    total_review_score bigint default 0
);

alter table books
    owner to root;

create unique index books_isbn_uindex
    on books (isbn);

